import web from '../src/images/3.jpg';
import web1 from '../src/images/4.jpg';
import web2 from '../src/images/mobile.jpg';
import web3 from '../src/images/11.jpg';
import web4 from '../src/images/12.jpg';
import web5 from '../src/images/1.jpg';


const Sdata = [
    {
        imgsrc: web,
        title: "web development",
    },
    {
        imgsrc: web1,
        title: "App development",
    },
    {
        imgsrc: web2,
        title: "Mobile development",
    },
    {
        imgsrc: web3,
        title: "Software development",
    },
    {
        imgsrc: web4,
        title: "cloud development",
    },
    {
        imgsrc: web5,
        title: " Digital Marketing",
    },
];

export default Sdata;
